import { SafeAreaView, View, Text, StyleSheet } from 'react-native'

export default function GamesScreen({ navigation }) {
    return(
        <SafeAreaView style={styles.container}>
            <Text>Games</Text>
        </SafeAreaView>
    )
}

const styles = StyleSheet.create({
    container:{
        flex: 1,
        backgroundColor: '#222831'
    }
})
